import React from 'react';
import style from './Header.css';

const Header = () => {
  return (
    <header className={style.header}>
      <img
        className={style.img}
        src="https://w3schoolsrus.github.io/images/img_5terre.jpg"
        alt="kartinka"
      />
    </header>
  );
};
export default Header;
